CREATE TABLE ACCOUNT(
    ID BIGINT NOT NULL,
    NAME VARCHAR(36) NOT NULL,
    SALT VARCHAR(256) NOT NULL,
    CREATE_TIME DATETIME NOT NULL,
    SECRET VARCHAR(256) NOT NULL,
    STATUS INT NOT NULL,
    EXPIRED_TIME TIMESTAMP DEFAULT '2000-1-1 0:00:00' NOT NULL,
    primary key(id)
);

CREATE TABLE ACCOUNT_ACTIVATION(
    ID BIGINT NOT NULL,
    USER_ID BIGINT NOT NULL,
    USER_CODE VARCHAR(256) NOT NULL,
    CREATE_TIME DATETIME NOT NULL,
    EXPIRED_TIME TIMESTAMP DEFAULT '2000-1-1 0:00:00' NOT NULL,
    primary key(id)
);

CREATE TABLE COMMENT(
    ID BIGINT NOT NULL,
    STORY_ID BIGINT NOT NULL,
    OWNER_ID BIGINT NOT NULL,
    COMMENT VARCHAR(256) NOT NULL,
    CREATE_TIME DATETIME NOT NULL,
    primary key(id)
);

CREATE TABLE CITY(
    ID BIGINT NOT NULL,
    NAME VARCHAR(36) NOT NULL,
    TITLE VARCHAR(128) NOT NULL,
    TYPE INT NOT NULL,
    LATITUDE DOUBLE NOT NULL,
    LONGITUDE DOUBLE NOT NULL,
    primary key(id)
);

CREATE TABLE STORY(
    ID BIGINT NOT NULL,
    URL VARCHAR(1024) NOT NULL,
    SUBJECT VARCHAR(256) NOT NULL,
    DESCRIPTION VARCHAR(256) NOT NULL,
    LATITUDE DOUBLE DEFAULT 0 NOT NULL,
    LONGITUDE DOUBLE DEFAULT 0 NOT NULL,
    TAKE_TIME DATETIME NOT NULL,
    CREATE_TIME DATETIME NOT NULL,
    OWNER_ID BIGINT NOT NULL,
    NAME VARCHAR(128) DEFAULT '' NOT NULL,
    primary key(id)
);

CREATE TABLE TRAVELLER(
    ID BIGINT NOT NULL,
    NAME VARCHAR(36) NOT NULL,
    CREATE_TIME DATETIME NOT NULL,
    AVATAR VARCHAR(256) NOT NULL,
    GENDER BIT DEFAULT 0 NOT NULL,
    STATUS VARCHAR(256) DEFAULT '' NOT NULL,
    primary key (id)
);



